import { Avatar, Dialog, DialogTitle, Typography } from "@material-ui/core";
import React from "react";

const DetailsDialog = (props) => {
	const { onClose, open, country } = props;

	return (
		<Dialog onClose={onClose} open={open}>
			{country && (
				<div>
					<Typography variant="h2">{country.name}</Typography>
					<Avatar variant="square" src={country.flag} />
					<Typography variant="h5">{country.capital}</Typography>
				</div>
			)}
		</Dialog>
	);
};

export default DetailsDialog;
